if mibBuilder.loadTexts: sysAddCard.setDescription('Add card operation given type, shelf, slot, and optionally sub card type. The format is (type,shelf, slot[,optional]). If the fourth optional parameter is present, for OCMITU/OCMU, its value should be 1 to indicate OCMITU/OCMU with CSIM; for MCMESC, its value should be 0 or 1 to indicate MPM will not overide or will override the settings stored on MCMESC upon detecting it. Different types of card: OCMU: 2 //with or without csim module OCMI: 3 //with or without csim module OFCM: 4 OFCD: 5 FADM: 6 MCMT1: 8 W4CD: 10 W2CM/D: 13 OSAM: 20 W4CM: 21 RSM: 22 UPSM: 23 OCME: 24 OCM10G: 27 OSAM-LP: 29 OSAM-HP: 30 MCMESC: 33 WFADM: 34 MCME1: 35 MD100-1: 36 MD100-40: 37 TAP: 38 MD100-5 39 MD100-10 40 OCM10GLR 41 BD-4 42 BP-10 43 DMM 45 BP-5 46 OSC 48 OCM2 49 OCM10GF 50 OCM2-4G 51 OET 52 UOB 53 FC8G 54 MD100P 55 CWDM_BD4 56 For example, to add a FADM card in shelf 1, slot 8, this variable will be set to 6,1,8. To add an OCMI card with colorsim module in shelf 1, slot 7, this variable will be set to 3,1,7,1. To add an MCMESC card with override option in shelf 1, slot 7, this variable will be set to 33,1,7,1. A get on this will return 0,0,0,0')
